message:
Da comida que comemos, da água que bebemos ao ar que respiramos, tudo nos dias de hoje parece capaz de nos matar. Recentemente, vimos um número sem precedentes de mortes devido a medicamentos para doenças que podem nem existir, cânceres obscuros causados por nossos dispositivos modernos e táticas policiais brutais. Tudo uma coincidência? Pense de novo. Em Controle Populacional, o aclamado jornalista Jim Marrs apresenta um argumento impressionante para sua conspiração mais audaciosa até agora: o esquema arquitetado por um punhado de elites globais para reduzir a população mundial para 500 milhões por todos os meios necessários e lucrar com isso.

Livro exclusivo traduzido 
@conhecimentoproibido

